import React from "react";
import "./FaceRecognition.css";

const FaceRecognition = ({ imageUrl, box }) => {
	return (
		<div className="center ma">
			<div className="absolute mt2">
				<img
					id="inputimage"
					alt=""
					src={imageUrl}
					width="500px"
					height="auto"
				/>
				<div
					className="box"
					style={{
						top: box.top_row,
						right: box.right_col,
						bottom: box.bottom_row,
						left: box.left_col,
					}}></div>
			</div>
		</div>
	);
};

export default FaceRecognition;
